import React from "react";
import "./MusicPage.css";

const MusicPage = () => {
  <script src="https://open.spotify.com/embed-podcast/iframe-api/v1" async></script>
  const Spotify = () => {
    window.onSpotifyIframeApiReady = (IFrameAPI) => {
      let element = document.getElementById('embed-iframe');
      let options = {
          url: 'https://open.spotify.com/playlist/2n5JJJkFQMlmdYOsopsd8n?si=a411d3cde62a4e9e'
        };
      let callback = (EmbedController) => {};
      IFrameAPI.createController(element, options, callback);
    };
  };
    return (
        <>
          {(
            
             
                <div id="space">
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="welcome"> WELCOME TO MY MUSIC PORTAL </div>
                    <div className="title"> MUSIC MOODZ </div>
                    <div className="caption">Choose a mood from the cards below for the perfect playlist</div> 
                    {/* <ReactPlayer url = "https://open.spotify.com/playlist/2n5JJJkFQMlmdYOsopsd8n?si=d9494a42af77457c"> */}
                    {/* <a style={{border:"12px", allow:"picture-in-picture"}} href="https://open.spotify.com/embed/playlist/2n5JJJkFQMlmdYOsopsd8n?utm_source=generator&theme=0" target="_blank" rel="noreferrer">
                    
                      <button type="button" className="box"> BEGIN</button>
                    
                   
                    </a> */}

                  {/* <iframe title="playlist" style={{border:"12px"}} src="https://open.spotify.com/embed/playlist/2n5JJJkFQMlmdYOsopsd8n?utm_source=generator&theme=0" width="50%" height="600" frameBorder="0" allowFullScreen="" allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture" loading="lazy">
                    
                  </iframe> */}

                  <button type="button" className="box" onClick={Spotify}> BEGIN</button>
                     
                </div>
                
              
            
          )}
        </>
    )
}

export default MusicPage
